import React, { Component } from "react";

class Nav extends Component {
    render() {
        return(
            <nav>
                <a href='/'>Home</a>
                <a href='/about'>About</a>
                <a href='/portfolio'>Portfolio</a>
                <a href='/contact'>Contact</a>
            </nav>
        )
    }
}

export default Nav;
